            <section class="main-equipe__historia">
                <div class="main-equipe__historia-container">
                    <h1>Nossa <strong>História</strong></h1>
                    <p>A <strong>Algoritmux</strong> foi fundada em 2021 por <strong>Guilherme Correia</strong>, com o propósito de criar uma nova forma de fazer <strong>Growth Marketing</strong>. Desde o início, sua metodologia foi construída com foco em correlacionar dados relacionais e transacionais, permitindo que a jornada de compra dos clientes se tornasse mais preditiva e eficiente. Esse diferencial ajudou a posicionar a Algoritmux como uma solução estratégica na construção de reputação digital e na entrega de resultados inteligentes.</br></br>
                    Em 2023, a empresa entrou em uma nova fase com a chegada de <strong>Hugo Hoch</strong> como sócio. Essa mudança trouxe não apenas um novo fôlego, mas também a oportunidade de dar início ao <strong>Motor 2</strong>, um projeto que até então não existia. Para isso, Hugo trouxe ao time um engenheiro de dados, viabilizando o desenvolvimento de uma ferramenta inovadora de inteligência de marketing. Essa ferramenta, desenhada para conectar dados de forma ainda mais robusta, elevou a entrega do Growth Marketing a um novo patamar, tornando-a mais tecnológica e assertiva.</br></br>
                    Hoje, a Algoritmux combina dados, tecnologia e marketing para entregar resultados excepcionais, se consolidando como uma referência em Growth Marketing. Esse é apenas o começo de uma jornada que promete continuar moldando o futuro do marketing.
                    </p>
